using Microsoft.AspNetCore.Mvc;
using NUnit.Framework;
using RatingCore.Api.Controllers;
using RatingCore.Api.DTO;
using RatingCore.GoogleCP;
using RatingCore.GoogleCP.Models;
using System;
using System.Collections.Generic;
using System.Linq;

namespace Tests
{
    public class ImageControllerTests : BaseTests
    {
        [SetUp]
        public void Setup()
        {
        }

        [Test]
        public void GetSimilar()
        {
            var image = "";
            var bytes = Convert.FromBase64String(image);
            var factory = new ClientFactory();
            var service = new GoogleApiService(factory, new GcpProjectInfo()
            {
                ComputeRegion = _computeRegion,
                ProjectID = _projectID
            });
            var controller = new ImageController(service);
            OkObjectResult res = (OkObjectResult)(controller.GetSimilar( new ImageRequest() { Base64Image = bytes }).Result);
            var data = res.Value as List<ProductSearchResult>;

            Assert.IsTrue(data != null);
            Assert.IsTrue(data.Any());
        }

        [Test]
        public void Add()
        {
            var image = "";
            var bytes = Convert.FromBase64String(image);
            var factory = new ClientFactory();
            var service = new GoogleApiService(factory, new GcpProjectInfo()
            {
                ComputeRegion = _computeRegion,
                ProjectID = _projectID,
                BucketName = _bucketName
            });
            var controller = new ImageController(service);
            var dto = new CreateRateableRequest() { Base64Image = bytes, Name = "MadDog12345_AddSet", FileName = "MadDog12345.png" };

            var res = controller.CreateNewRateable(dto).Result;
            Assert.IsTrue( ((OkObjectResult)res).StatusCode == 200 );
        }
    }
}